import React from 'react';
import Tooltip from 'react-bootstrap/Tooltip';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import Button from 'react-bootstrap/Button';
import Image from 'react-bootstrap/Image';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const renderTooltip = props=> {
    return (
    <Tooltip id={props.info.id} {...props} >
        {props.info.title}
    </Tooltip>
);}

const CustomTooltip = props => {
    console.log(props);
    return (

        <OverlayTrigger
            placement="bottom"
            // delay={{ show: 250, hide: 400 }}
            // overlay={ () => renderTooltip ( props ) }
            overlay={
                <Tooltip id={props.info.id} >
                    hello
                </Tooltip>
            }
        >
            {/* {({ ref, ...triggerHandler }) => (
                props.element
            )} */}

            {({ ref, ...triggerHandler }) => (

                <Button
                    variant="light"
                    {...triggerHandler}
                    className="d-inline-flex align-items-center"
                >
                    {/* <Image
                    ref={ref}
                    roundedCircle
                    src="holder.js/20x20?text=J&bg=28a745&fg=FFF"
                    /> */}
                     <FontAwesomeIcon 
                        icon='plus-circle'
                        ref={ref}
                        onClick={ () => this.sessionCreateHandler(this.props.workout._id)}
                     />
                    <span className="ml-1"                     ref={ref}>Hover to see</span>
                </Button>
            )}
        </OverlayTrigger>
    )
}


export default CustomTooltip;
